function populateNavbar(a, b, c) {
    d3.json(a, function(a) {
        a = d3.select("#menu-items").append("ul").attr("class", "nav navbar-nav navbar-right").style("margin", "10px 0px").selectAll("a").data(a.accounts.filter(function(a) {
            return -1 < b.indexOf(a.name);
        })).enter().append("a").style("color", c).attr("target", "_blank").attr("href", function(a) {
            return a.url;
        }).attr("title", function(a) {
            return a.name;
        }).append("span").attr("class", "fa-stack");
        a.append("i").attr("class", "fa fa-circle fa-stack-2x");
        a.append("i").attr("class", function(a) {
            return "fa " + a.icon + " fa-stack-1x fa-inverse";
        });
    });
}
function setHeading(a, b) {
    var c = a.append("div").attr("class", "container-fluid").append("div").attr("class", "row text-center");
    c.append("h2").attr("class", "section-heading").text(b);
    c.append("hr").attr("class", "primary");
}
function getContainer(a, b) {
    return a.append("div").attr("class", b);
}
function loadFooter(a) {
    $("#footer").load(a);
}